import Cars from "./components/Cars/Cars";
import "./index.css";

function App() {
  const isBackgroundRed = true;
  return (
    <React.Fragment>
      <Login
        className={isBackgroundRed ? "background-red" : "background-blue"}
      />
    </React.Fragment>
  );
}
export default App;
